import sys
from collections import defaultdict
from math import atan2, pi


def get_touches(image):
    touches = defaultdict(list)
    for y, line in enumerate(image):
        for x, c in enumerate(line):
            if c == 'X':
                touches[(x, y)].append((x, y))
    return touches


def get_grip(touches):
    x = 0
    y = 0
    for t in touches:
        x += t[0]
        y += t[1]
    x /= len(touches)
    y /= len(touches)
    return (x, y)


def get_grip_spread(touches, grip):
    s = 0
    for t in touches:
        s += ((t[0] - grip[0]) ** 2 + (t[1] - grip[1]) ** 2) ** 0.5
    return s / len(touches)


def get_grip_rotation(touches, grip):
    s = 0
    for t in touches:
        v = atan2(t[1] - grip[1], t[0] - grip[0])
        s += v
    return s / len(touches)


def get_touch_vector(touch, grip):
    return (touch[0] - grip[0], touch[1] - grip[1])


def get_distance(touch1, touch2):
    return ((touch1[0] - touch2[0]) ** 2 + (touch1[1] - touch2[1]) ** 2) ** 0.5


def get_angle(touch1, touch2):
    v1 = atan2(touch1[1], touch1[0])
    v2 = atan2(touch2[1], touch2[0])
    return v1 - v2


def get_gesture(image1, image2):
    touches1 = get_touches(image1)
    touches2 = get_touches(image2)
    grip1 = get_grip(touches1)
    grip2 = get_grip(touches2)
    grip_spread1 = get_grip_spread(touches1, grip1)
    grip_spread2 = get_grip_spread(touches2, grip2)
    grip_rotation1 = get_grip_rotation(touches1, grip1)
    grip_rotation2 = get_grip_rotation(touches2, grip2)
    touch_vectors1 = {}
    for t in touches1:
        touch_vectors1[t] = get_touch_vector(t, grip1)
    touch_vectors2 = {}
    for t in touches2:
        touch_vectors2[t] = get_touch_vector(t, grip2)
    pan_distance = get_distance(grip1, grip2)
    zoom_distance = grip_spread2 - grip_spread1
    rotation_distance = abs(grip_rotation2 - grip_rotation1)
    if abs(pan_distance - zoom_distance) < 1e-5 and abs(pan_distance -
        rotation_distance) < 1e-5:
        return 'pan', pan_distance
    if abs(zoom_distance - pan_distance) < 1e-5 and abs(zoom_distance -
        rotation_distance) < 1e-5:
        if zoom_distance > 0:
            direction = 'out'
        else:
            direction = 'in'
        return 'zoom', direction, zoom_distance
    if abs(rotation_distance - pan_distance) < 1e-5 and abs(rotation_distance -
        zoom_distance) < 1e-5:
        if rotation_distance > 0:
            direction = 'clockwise'
        else:
            direction = 'counter-clockwise'
        return 'rotate', direction, rotation_distance
    if pan_distance > zoom_distance and pan_distance > rotation_distance:
        return 'pan', pan_distance
    if zoom_distance > pan_distance and zoom_distance > rotation_distance:
        if zoom_distance > 0:
            direction = 'out'
        else:
            direction = 'in'
        return 'zoom', direction, zoom_distance
    if rotation_distance > pan_distance and rotation_distance > zoom_distance:
        if rotation_distance > 0:
            direction = 'clockwise'
        else:
            direction = 'counter-clockwise'
        return 'rotate', direction, rotation_distance


