        return n // 2
    else:
        return n // 2 + 1


def h(n):
    if n % 2 == 0:
        return n // 2
    else:
        return n // 2


def solve(l, r):
    if l == 1:
        return (r * (r + 1)) // 2
    else:
        return (g(l - 1) * l + h(l - 1) * (r - l + 1)) % (10 ** 9 + 7)


l, r = list(map(int, input().split()))
print(solve(l, r))

